import React from 'react';
import './App.css';
import { BsLinkedin, BsFacebook, BsGithub,BsInstagram } from "react-icons/bs";

function App() {
  return (
    <main className='main'>

    <div className="title">
     <div className='titleBar'>
       <a href='#'>
       <img className='avatar' src={require('./diego.png')} />
       </a>
     </div>

     <div className='privateData'>
      <a href='https://www.linkedin.com/in/diego-mendes-da-silva-7a80a6229/'> <BsLinkedin/></a>
      <BsFacebook/> 
      <a href='https://github.com/diegomendeskp'> <BsGithub/> </a>
      <a href='https://www.instagram.com/hunterp7/'> <BsInstagram/></a>
     </div>

     <div className='menuBar'>
     <a href='#' >Home</a> 
     <a href='#' >sobre</a>
     <a href='#' >Habilidades</a>
     <a href='#' >Projetos</a>
     </div>
    </div>


    </main>

  );
}

export default App;
